import * as React from 'react';
import './App.css';

function App() {
    const [pageNumber, setPageNumber] = React.useState<number>(1);

    let electricType: PokemonType = {
        id: 0,
        name: "electric",
    }

    let waterType: PokemonType = {
        id: 0,
        name: "water",
    }

    let pikachu: Pokemon = {
        name: "Pikachu",
        weight: 15,
        height: 10,
        id: 1,
        types: [electricType, waterType]
    }
    return (
        <body>
        <div className="App">
            <Page pageNumber={1}/>
        </div>
        </body>
    );
}

import {PokemonList} from "./component/PokemonList";
import {Pokemon} from "./model/Pokemon";
import {PokemonType} from "./model/PokemonType";

import {Page} from "./component/Page";

export default App;
